import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import StatisticsGrid from './StatisticsGrid';

const SummarySection = styled.div`
  padding: 50px 40px;
  border-bottom: 1px solid #e2e8f0;
  position: relative;
`;

const SectionHeader = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 35px;
  padding-bottom: 20px;
  border-bottom: 3px solid #1e3a8a;
  width: 100%;
`;

const SectionIcon = styled.div`
  width: 40px;
  height: 40px;
  background: #1e3a8a;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.2rem;
  margin-right: 15px;
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 1.6rem;
  font-weight: 700;
  color: #1e3a8a;
  margin: 0;
`;

const BodyText = styled.p`
  font-size: 1.1rem;
  line-height: 1.8;
  color: #374151;
  margin-bottom: 25px;
  text-align: justify;
  max-width: 100%;
`;

const HighlightText = styled.span`
  background: #fef3c7;
  padding: 2px 6px;
  border-radius: 3px;
  font-weight: 600;
`;

const ExecutiveSummary = () => {
  return (
    <SummarySection>
      <SectionHeader>
        <SectionIcon>ðŸ“‹</SectionIcon>
        <SectionTitle>Executive Summary</SectionTitle>
      </SectionHeader>

      <motion.div
        initial={{ opacity: 0, y: 30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.3 }}
      >
        <BodyText>
          This comprehensive longitudinal study examines how primary care clinicians' engagement 
          with Medicaid evolved from 2016 to 2019, tracking <HighlightText>220,665 clinicians</HighlightText> across 
          40 states. The analysis reveals significant volatility in Medicaid participation patterns, 
          with important implications for healthcare access and policy.
        </BodyText>
      </motion.div>

      <StatisticsGrid />
    </SummarySection>
  );
};

export default ExecutiveSummary;
